const Navbar = () => {

    function LoginChange() {
        console.log("Hello");
    }

    function LogOutChange(userName, e) {
        console.log("Good Bye"+userName);
    }

    return ( 
        <nav className="navbar">
            <h1>The Dojo Blog</h1>
            <div className="links">
                <a href="/">Home</a>
                <a href="/create">New Blog</a>
                <button onClick={LoginChange}>LogIn</button>
                <button onClick={() => {
                    LogOutChange(' Raiyan');
                }}>LogOut</button>
            </div>
        </nav>
     );
}

export default Navbar;
